import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import "react-tabs/style/react-tabs.css";


class App extends Component {
  render() {
    return (
      <div className="App">
      <Header/>
      <Test/>
      </div>
    );
  }
}

export default App;
